  }, ": \uBE44\uACF5\uAC1C\uB85C \uB0A8\uC544\uC788\uC5C8\uB358 \uAE00")), mdx("hr", null), mdx("p", null, "\uC544\uCE68 5\uC2DC 30\uBD84 \uAE30\uC0C1. 6\uC2DC\uAE4C\uC9C0 \uC0AC\uC9C1 \uC218\uC601\uC7A5\uC73C\uB85C \uC774\uB3D9. 7\uC2DC\uAE4C\uC9C0 \uC218\uC601\uAC15\uC2B5. 7\uC2DC 50\uC5EC\uAE4C\uC9C0 \uB9E5\uBAA8\uB2DD. 8\uC2DC 20\uBD84\uC5EC\uAE4C\uC9C0 \uC0AC\uBB34\uC2E4. \uC0AC\uBB34\uC2E4\uC5D0\uC11C \uD314\uAD7D\uD600\uD3B4\uAE30\uC640 \uC717\uBAB8\uC77C\uC73C\uD0A4\uAE30 \uC6B4\uB3D9. \uC624\uB298\uC740 \uD2B9\uBCC4\uD788 \uC544\uCE68 \uC124\uAC70\uC9C0\uAE4C\uC9C0."), mdx("p", null, "\uD654, \uC218, \uBAA9, \uAE08\uC758 \uC624\uC804\uC740 \uD56D\uC0C1 \uC774\uB7F0\uC2DD\uC73C\uB85C \uC2DC\uC791\uB41C\uB2E4. \uC6B4\uB3D9\uC744 \uAFB8\uC900\uD788 \uD558\uBA74\uC11C \uCCB4\uC911\uC744 \uC904\uC774\uB294 \uAC83\uC774 \uBAA9\uD45C\uC600\uB294\uB370, \uC800\uBC88\uC8FC\uAE4C\uC9C0 1kg\uAC00\uB7C9\uC744 \uBE8F\uC5C8\uB2E4. \uC8FC\uB9D0\uC744 \uC9C0\uB098\uACE0, \uCE5C\uAD6C\uB4E4\uC774\uB791 \uC220\uC790\uB9AC\uB97C \uAC00\uC9C0\uB2E4\uBCF4\uB2C8, \uC624\uB298\uC740 \uC6D0\uB798 \uCCB4\uC911\uC778 69kg\uC5D0 \uAC00\uAE4C\uC6CC\uC84C\uB2E4. \uC0B4\uC744 \uBE7C\uB294\uB370\uB294 \uB9CE\uC740 \uB0A0\uC774 \uAC78\uB9AC\uC9C0\uB9CC, \uB2E4\uC2DC \uC6D0\uB798\uB300\uB85C \uB3CC\uC544\uC624\uB294\uAC74 \uC21C\uC2DD\uAC04\uC774\uB2E4. \uC774\uC804\uC758 \uC2B5\uAD00\uC774 \uADF8\uB300\uB85C \uB3CC\uC544\uC654\uAE30 \uB54C\uBB38\uC5D0, \uB2E4\uC2DC \uC774\uC804 \uC0C1\uD0DC\uB85C \uB418\uAE30\uB294 \uB9E4\uC6B0 \uC27D\uB2E4. \uC624\uB298 \uC870\uAE08 \uC0DD\uAC01\uC744 \uD558\uACE0 \uB118\uC5B4\uAC00\uC57C\uD560 \uAC83 \uAC19\uC544\uC11C \uAE00\uC744 \uC4F4\uB2E4. \uD558\uB8E8\uD558\uB8E8 \uC0DD\uD65C\uC774 \uD328\uD134\uD654 \uB418\uACE0 \uC788\uB294\uB370, \uC88B\uC740 \uC2B5\uAD00\uC73C\uB85C \uC790\uB9AC\uB9E4\uAE40\uD55C \uAC83\uB4E4\uB3C4 \uC788\uC9C0\uB9CC, \uC54C\uAC8C\uBAA8\uB974\uAC8C \uC2DC\uAC04\uB9CC \uB0AD\uBE44\uD558\uBA74\uC11C \uD558\uB8E8\uB97C \uBCF4\uB0B4\uB294 \uD589\uB3D9\uB4E4\uB3C4 \uAF64 \uC788\uB294 \uAC83 \uAC19\uB2E4. \uC0AC\uBB34\uC2E4\uC5D0\uC11C \uC9C0\uB0B4\uB294 \uC2DC\uAC04\uC5D0\uC11C \uBB54\uAC00 \uB2A5\uB3D9\uC801\uC774\uACE0 \uD65C\uBC1C\uD55C \uD65C\uB3D9\uC774 \uC5C6\uB294 \uAC83 \uAC19\uB2E4\uB294 \uC0DD\uAC01\uC774 \uB4E0\uB2E4. \uB8E9\uC2A4\uB77C\uC774\uD06C\uB97C \uC624\uD508\uD558\uACE0, \uC6B4\uC601\uC801\uC778 \uBA74\uC5D0\uC11C \uC870\uAE08 \uB354 \uC9C0\uCF1C\uBCF4\uC790\uB294 \uC0DD\uAC01\uC744 \uD558\uACE0 \uC788\uC5C8\uB294\uB370, \uADF8 \uC2DC\uAC04\uB3D9\uC548\uC5D0 \uB0B4\uAC00 \uC9D1\uC911\uC801\uC73C\uB85C \uD560\uC77C\uC774 \uC5C6\uC5B4\uC9C4 \uAC83\uC774\uB2E4. \uC790\uB8CC\uB97C \uC62C\uB9AC\uACE0, \uC218\uC815\uD558\uACE0, \uC11C\uBC84\uC758 \uC870\uADF8\uB9CC\uD55C \uAE30\uB2A5\uC744 \uCD94\uAC00\uD558\uB294 \uC77C \uC678\uC5D0 \uB531\uD788 \uC77C\uC774 \uC5C6\uAE30 \uB54C\uBB38\uC774\uB2E4. \uB2E4\uC74C\uC744 \uC704\uD55C \uACF5\uBD80\uB97C \uD558\uB294 \uAC83\uC774 \uC88B\uB2E4\uB294 \uC0DD\uAC01\uC774 \uB4E4\uC5C8\uB2E4. \uC5EC\uAE30\uC5D0 \uAE00\uC744 \uC801\uC73C\uBA74\uC11C \uB0B4\uAC00 \uBB34\uC5C7\uC744 \uC704\uD574 \uC0B4\uC544\uC57C\uD558\uACE0, \uC5B4\uB5BB\uAC8C \uC0B4\uC544\uC57C\uD560\uC9C0\uC5D0 \uB300\uD574\uC11C \uC0DD\uAC01\uD574\uBCF4\uBA74 \uC88B\uC9C0 \uC54A\uC744\uAE4C."), mdx("p", null, "\uC774\uC0C1\uD558\uAC8C \uC624\uB298 \uAE00\uC740 \uC911\uAD6C\uB09C\uBC29\uC73C\uB85C \uC801\uC5B4\uC9C0\uB294 \uAC83 \uAC19\uB2E4. \uC774\uB9AC \uC800\uB9AC \uC0DD\uAC01\uB098\uB294\uB370\uB85C \uC801\uC73C\uB2C8 \uB9D0\uC774\uB2E4."), mdx("p", null, "\uD68C\uC0AC \uC77C\uC815\uC740 \uB300\uB7B5 5\uC2DC\uC5D0\uC11C 6\uC2DC\uC5D0 \uB05D\uB098\uACE0, \uADF8 \uC774\uD6C4\uC5D0 \uC9D1\uC73C\uB85C \uB3CC\uC544\uAC04\uB2E4. \uB3D9\uB798\uC5D0\uC11C \uC9C0\uD558\uCCA0\uC744 \uAC78\uC5B4, \uC9C0\uD558\uCCA0 \uC544\uB798\uB85C \uB098\uC788\uB294 \uC628\uCC9C\uCC9C\uC744 \uB530\uB77C \uAC77\uB294\uB2E4. \uAC77\uB294 \uC640\uC911\uC5D4 \u2018\uACE0\uC804 \uC77D\uAE30\u2019 \uD31F\uCE90\uC2A4\uD2B8\uB97C \uB4E4\uC73C\uBA70 \uAC04\uB2E4. \uB300\uB7B5 \uC7A5\uC804\uC5ED\uC5D0\uC11C \uD31F\uCE90\uC2A4\uD2B8 \uD558\uB098\uAC00 \uB05D\uB098\uBA70, \uC7A5\uC804\uC5ED\uC5D0\uC11C \uC9D1\uC73C\uB85C \uC62C\uB77C\uAC00\uB294 \uAE38\uC5D4 \uAC04\uB2E8\uD55C \uBE75\uAC19\uC740 \uC694\uAE43\uAC70\uB9AC\uB97C \uC0AC\uC11C \uBA39\uC73C\uBA70, \uBC95\uB95C \uC2A4\uB2D8\uC758 \uD31F\uCE90\uC2A4\uD2B8 \uD558\uB098\uB97C \uB4E4\uC73C\uBA70 \uC9D1\uC73C\uB85C \uAC04\uB2E4. \uC9D1\uC5D0 \uB3C4\uCC29\uD574\uC11C\uB294 \uC0C1\uD6C8\uC774\uB791 \uC870\uAE08 \uC774\uC57C\uAE30\uD558\uB2E4\uAC00 \uAC8C\uC784\uC744 \uD558\uAC70\uB098, \uB4DC\uB77C\uB9C8, \uC608\uB2A5 \uD504\uB85C\uADF8\uB7A8 \uB4F1\uC744 \uBCF8\uB2E4. 11\uC2DC\uC5D0\uC11C 12\uC2DC \uC0AC\uC774\uC5D0 \uAC8C\uC784\uC744 \uB05D\uB0B4\uACE0 \uC7A0\uC790\uB9AC\uC5D0 \uB4E0\uB2E4."), mdx("p", null, "\uC74C\u2026 \uC774\uB9AC \uC800\uB9AC \uC654\uB2E4\uAC14\uB2E4 \uC815\uC2E0\uC5C6\uB124. \uD14C\uB4DC \uAC15\uC5F0\uC744 \uBCF4\uB7EC\uAC14\uB2E4\uAC00, \uAC11\uC790\uAE30 \uC0DD\uAC01\uB09C \u2018\uC815\uC758\uB780 \uBB34\uC5C7\uC778\uAC00\u2019 \uAC15\uC758\uB97C \uB4E3\uC9C0\uB97C \uC54A\uB098, \uD50C\uB798\uB108\uC5D0 \uC624\uB298 \uD574\uC57C\uD560\uC77C\uC744 \uC801\uB2E4\uAC00, \uD638\uCC3D\uC774 \uD584\uACFC \uB300\uD654\uB97C \uD558\uAE30\uB3C4 \uD558\uC600\uB2E4\uAC00, \uB8E9\uC2A4\uB77C\uC774\uD06C \uB2E4\uC74C \uC5C5\uB370\uC774\uD2B8\uC5D0 \uB300\uD574 \uC0DD\uAC01\uD574\uBD24\uB2E4\uAC00. \uC774\uAC83\uC774 \uC21C\uCC28\uC801\uC73C\uB85C \uC9C4\uD589\uB418\uB294 \uAC83\uC774 \uC544\uB2C8\uB77C, \uC21C\uAC04\uC21C\uAC04 \uBC14\uB00C\uC5B4 \uC9D1\uC911\uD558\uC9C0 \uBABB\uD558\uB294 \uAC83 \uAC19\uB2E4."), mdx("p", null, "\uAC11\uC790\uAE30 \uC2DC\uAC04\uC744 \uAC00\uC9C0\uACE0 \uC0DD\uAC01\uC744 \uD558\uB824\uD558\uB2C8 \uC548\uB418\uB294 \uAC83\uC77C\uAE4C."), mdx("p", null, "\uC5C7\u2026 \uAC15\uC758 \uD558\uB098 \uB4E3\uACE0, \uB2F9\uC2E0\uC758 \uC120\uD0DD \uC0AC\uC9C4 \uC62C\uB9AC\uACE0, \uC601\uD6C8\uC774 \uC694\uCCAD\uC5D0 \uC218\uC815\uD558\uB2E4\uBCF4\uB2C8 \uBC8C\uC368 1\uC2DC\uAC00 \uB2E4\uB418\uAC04\uB2E4. \uAC04\uB2E8\uD788 \uC810\uC2EC\uC744 \uBA39\uACE0 \uC790\uB9AC\uC5D0 \uC549\uC558\uB2E4. \uAE00\uC740 \uC624\uB298 \uC644\uB8CC\uB420 \uC218 \uC788\uC744\uAE4C?"));
